import React from 'react';
import {View,Text} from 'react-native'

const Header = (props) => {
    const name=props.root.name;

    React.useEffect(()=>{
        console.log(props)
    },[])
    return (
        <View>
            <Text>{name}</Text>
        </View>
    );
};

export default Header;
